"use strict";


let target_input_selector = null;

let search_icon = "";

let icons = [];
let tmp_icons = [];

let icons_fontawesome = [];
let icons_moon = [];
let icons_material = [];

const InitIconCollection = (collection = 1) => {

    icons_fontawesome = fontawesome_str.match(/<i (.*?)<\/div><\/div>/g);
    icons_moon = moon_str.match(/<i (.*?)<\/div><\/div>/g);
    icons_material = material_str.match(/<i (.*?)<\/div><\/div>/g);

    if (collection != 2 || collection != 3)
        collection = 1;
    setSelectedIconsSet(collection);

}
const OpenIconsModal = (selector) => {
    if (!selector || selector.length == 0)
        return;

    target_input_selector = selector;
    $('#icons-collections-modal').modal('show');
};
function setSelectedIconsSet(collection) {

    if (collection == 2) {
        icons = icons_moon;

        $('#font-icons').removeClass('btn-success');
        $('#moon-icons').removeClass('btn-light-dark').addClass('btn-success');
        $('#material-icons').removeClass('btn-success');
    }
    else if (collection == 3) {
        icons = icons_material;

        $('#font-icons').removeClass('btn-success');
        $('#moon-icons').removeClass('btn-success');
        $('#material-icons').removeClass('btn-light-dark').addClass('btn-success');
    }
    else {
        icons = icons_fontawesome;

        $('#font-icons').removeClass('btn-light-dark').addClass('btn-success');
        $('#moon-icons').removeClass('btn-success');
        $('#material-icons').removeClass('btn-success');
    }

    tmp_icons = icons;

    tmp_icons = icons.filter(i => i.includes(search_icon)) ?? [];
    createIconsHtmlInModal(tmp_icons);
}
function searchIcons(event) {
    search_icon = event?.value;
    tmp_icons = icons.filter(i => i.includes(search_icon)) ?? [];
    createIconsHtmlInModal(tmp_icons);
}
function createIconsHtmlInModal(arr) {
    let icons_div = document.getElementById('icons-collections');
    icons_div.innerHTML = "";
    arr.forEach(icon => {
        let sub_div = document.createElement('div');
        sub_div.className = "col-md-3 col-sm-4";

        let icon_div = document.createElement('div');
        icon_div.className = "d-flex align-items-center icons_selector";
        icon_div.style.cursor = 'pointer';
        icon_div.onclick = function (e) { assignSelectedIconToSelectedSectionInput(e); }
        icon_div.innerHTML = icon;

        sub_div.appendChild(icon_div);
        icons_div.appendChild(sub_div);
    });
}
function assignSelectedIconToSelectedSectionInput(e) {
    let target = e?.target ?? "";
    let i_tag = target?.outerHTML?.match(/<i(.*?)<\/i>/g);
    if (i_tag && i_tag[0]) {
        let classes = i_tag[0]?.match(/"(.*?)"/g);
        if (classes && classes[0]) {
            let class_name = classes[0].replace(/\"/g, "");
            const target_inputs = $(target_input_selector);

            target_inputs.val(class_name);
            const event = new CustomEvent('input', { bubbles: true, detail: { 'selector': target_input_selector } });
            target_inputs[0].dispatchEvent(event);
            $('#icons-collections-modal').modal('hide');
        }
    }
}



